import React from 'react';
import EditorJS from '@editorjs/editorjs';

const AboutUs = () => {
    const editor = new EditorJS({
        /**
         * Id of Element that should contain Editor instance
         */
        holder: 'editorjs'
      });
      console.log("editor",editor)
    return (
        <div>
            {editor}
        </div>
    );
}

export default AboutUs;
